import numpy as np
import matplotlib.pyplot as plt
from IPython.display import (
    display, HTML, Markdown, Latex, SVG, Image, JSON, Javascript, Audio, Video
)
from PIL import Image as PILImage
import requests
from io import BytesIO


def generate_text_plain():
    return "This is a plain text output."


def generate_text_html():
    return HTML("<h3 style='color:blue;'>This is an HTML output</h3>")


def generate_text_markdown():
    return Markdown("### **This is Markdown Output**")

def generate_image_png():
    x = np.linspace(0, 10, 100)
    y = np.sin(x)
    fig, ax = plt.subplots()
    ax.plot(x, y)
    ax.set_title("Sine Wave")
    # display(fig)


