def generate_application_json():
    return JSON({"name": "Jupyter", "type": "Notebook"})

def generate_application_pdf():
    return HTML('<embed src="https://arxiv.org/pdf/1706.03762.pdf" width="800px" height="600px" />')


def generate_audio_wav():
    fs = 44100  # Sample rate
    t = np.linspace(0, 1, fs)
    wave = 0.5 * np.sin(2 * np.pi * 440 * t)  # 440 Hz sine wave
    return Audio(wave, rate=fs)

def generate_video_mp4():
